import React,{Component} from 'react';
import "./Skills.css"
import ProgressBar from '../ProgressBar/ProgressBar';
import SkillsBar from '../Skills/Skills';
class Skills extends Component{
    SkillsBar=require('./Skills.json')
    render(){

        return(
            <div id="skills-container" className="skills-container">
                <div className="skills-title title">My Skills</div><hr/>
                <div>
                <div className="right">
                <ProgressBar />
                </div>
                <div className="left">
                <ProgressBar />
                </div>
                </div>
            </div>

        );
    }
}

export default Skills;
